import React from "react"

class Home extends React.Component{
    render() {
        return(
            <div>
                <div>
                    <header></header>
                </div>
                <div>
                    <h1>Welcome to the Quizze app!</h1>
                    <button>Login</button>
                    <button>Sign up</button>
                    <button>Login as Admin</button>
                </div>
            </div>
        )
    }
}
export default Home
